const traductions = {
  FR: {
    auth: "Authentifiez-vous pour accéder à la calculette",
    connect: "connexion",
    mail: "Votre mail",
    psw: "Votre mot de passe",
    connectTwo: "Se connecter",
  },
  EN: {
    auth: "Authenticate yourself to access the calculator",
    connect: "connect",
    mail: "Your mail",
    psw: "Your password",
    connectTwo: "",
  },
};

export default traductions;
